// src/pages/Home.js
import React, { useEffect, useState } from "react";
import { useSelector, useDispatch } from "react-redux";
import {
  fetchCountries,
  filterByRegion,
  loadMore,
  selectFilteredCountries,
} from "../features/countrySlice";
import { Container, Row, Col, Button } from "react-bootstrap";
import "./Home.css";
import Carousel from "react-bootstrap/Carousel";

const Home = () => {
  const dispatch = useDispatch();
  const countries = useSelector(selectFilteredCountries);
  const visibleCount = useSelector((state) => state.countries.visibleCount);
  const [activeFilter, setActiveFilter] = useState("All");

  useEffect(() => {
    dispatch(fetchCountries());
  }, [dispatch]);

  const handleFilterClick = (region) => {
    setActiveFilter(region);
    dispatch(filterByRegion(region));
  };

  const handleLoadMore = () => {
    dispatch(loadMore());
  };

  return (
    <div className="home-page">
      <header className="top-header">
        <h5>Countries</h5>
        <div className="region-filters">
          {["All", "Asia", "Europe"].map((region) => (
            <button
              key={region}
              className={`region-button ${
                activeFilter === region ? "active" : ""
              }`}
              onClick={() => handleFilterClick(region)}
            >
              {region}
            </button>
          ))}
        </div>
      </header>

      <section className="welcome-section">
        <hr className="line" />
        <h2>WELCOME</h2>
        <hr className="line" />
      </section>

      <section className="slider-section">
        <Row>
          <Col md={8}>
            <Carousel indicators={true} controls={true}>
              <Carousel.Item>
                <div className="carousel-image">Image 1</div>
              </Carousel.Item>
              <Carousel.Item>
                <div className="carousel-image">Image 2</div>
              </Carousel.Item>
              <Carousel.Item>
                <div className="carousel-image">Image 3</div>
              </Carousel.Item>
            </Carousel>
          </Col>
          <Col md={4}>
            <div className="side-frame">Frame</div>
          </Col>
        </Row>
      </section>

      <Container className="countries-container">
        <Row>
          {countries.slice(0, visibleCount).map((country, idx) => (
            <Col md={6} key={idx} className="mb-4">
              <div className="country-card">
                <img src={country.flag} alt={country.name} className="flag" />
                <div className="country-details">
                  <strong>{country.name}</strong>
                  <div className="region">{country.region}</div>
                </div>
              </div>
            </Col>
          ))}
        </Row>
        {visibleCount < countries.length && (
          <div className="text-center mt-3">
            <Button variant="dark" onClick={handleLoadMore}>
              Load more
            </Button>
          </div>
        )}
      </Container>

      <footer className="footer">
        <div className="footer-icons">
          <i className="bi bi-facebook"></i>
          <i className="bi bi-twitter"></i>
          <i className="bi bi-instagram"></i>
          <i className="bi bi-github"></i>
        </div>
        <p>example@email.com</p>
        <p>Copyright Â© 2020 Name. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default Home;
